vec2 ro(float t) {
    return vec2(cos(t) - sin(t), sin(t) + cos(t));
}

void mainImage(out vec4 f, in vec2 c) {
    vec2 pos = (c.xy - iResolution.xy * 0.5) / iResolution.xy;
    float r = length(pos);
    pos = pos * ro(iTime * 2.0 + r * 19.0) / r;
    vec3 light = vec3(
        pow(
            sin((pos.x * 80.0) * cos(pos.y * 1.0 - vec3(0.95, 0.95, 0.9)) * cos(pos.y * 2.1 + vec3(0.9, 0.9, 0.95)) * cos(pos.x * 3.1 - vec3(0.9, 0.9, 0.5))),
            vec3(3.0)
        )
    );
    f = vec4(light, 1.0);
}
